description:
A dark forest. A deserted cabin. A mysterious dwarf. Each room an unimaginable delight. Toto, we're not in Kansas anymore. As she is lost in a dark forest, Laure enters what seems to be a deserted cabin. Suddenly, the door slams shut. No way to escape. With an unpleasant glint on his face, a dwarf appears and says to her: &quot;To get out, you'll have to catch the right key...!&quot;

